import React from "react";

const DoctorList = ({ doctors }) => {
  return (
    <div>
      {doctors.map((doctor) => (
        <div key={doctor.id} className="doctor-card" data-testid="doctor-card">
          <h3 data-testid="doctor-name">{doctor.name}</h3>
          <p data-testid="doctor-specialty">{doctor.specialties.join(", ")}</p>
          <p data-testid="doctor-experience">
            Experience: {doctor.experience} years
          </p>
          <p data-testid="doctor-fee">Fee: â‚¹{doctor.fee}</p>
        </div>
      ))}
    </div>
  );
};

export default DoctorList;
